import React, { Component } from 'react'
import { NavLink } from "react-router-dom";

export default class Navbar extends Component {
    render() {
        return (
            <div>
                <NavLink to="/">Product</NavLink>
                <NavLink to="/cart">Cart</NavLink>
                    
            </div>
        )
    }
}
